import React, { Component } from 'react';
import './App.css';
import GetImagen from './GetImagen';

const axios = require('axios');


class App extends Component {
  state = {
    gatitos: []
  }

  componentDidMount() {
    this.setState({ gatitos: [...Array(100)] })
  }

  llamar() {
    // Make a request for a user with a given ID
    axios.get('http://aws.random.cat/meow')
      .then(function (response) {
        // handle success
        console.log(response);
      })
      .catch(function (error) {
        // handle error
        console.log(error);
      })
      .then(function () {
        // always executed
      });
  }

  render() {
    return (
      <div className="App">
        {this.state.gatitos.map(() => {
          return this.printCat();
        })}
      </div>
    );
  }

  printCat = () => {
    return (
      <GetImagen imagen="https://bulma.io/images/placeholders/128x128.png" />
    )
  }

}

export default App;
